    const [code, setCode] = useState([])
    
    const fetchLoginCode = async () => {
        const response = await fetch("http://localhost:5555/get_code")
        const code_json = await response.json()
        setCode(code_json.data)
    }
    const createServer = async() => {
        const response = await fetch("http://localhost:5555/create_server")
    }
    const joinServer = async() => {
        const response = await fetch("http://localhost:5555/join_server", {
            method: "POST",
            headers: { "Content-Type": "application/json" },
            body: JSON.stringify(code)
        })
        const join_json = await response.json();

        if ("error" in join_json) {
            alert("error")
            return false;
        }
        return true;
    }

    return (
        <div className = "App">
            <button>Create Lobby</button>
            <button>Join</button>
        </div>
    );
}
export default Lobby;
